import React from "react";
import PoseFilter from "../components/PoseFilter";

export default function Poses() {
  const handlePoseSelect = (pose) => {
    console.log("Selected Pose:", pose);
  };

  return (
    <PoseFilter
      title="Asana Poses"
      poseApiUrl="http://127.0.0.1:8000/api/poses/"
      categoryApiUrl="http://127.0.0.1:8000/api/categories/"
      onPoseSelect={handlePoseSelect}
    />
  );
}
